                            {/*    <option value="option5">13:00</option>*/}
                            {/*    <option value="option6">13:30</option>*/}
                            {/*    <option value="option7">14:00</option>*/}
                            {/*</select>*/}
                        </div>
                        <div >
                        <label htmlFor="phoneNumber" style={{ display: 'none' }}>
                            –í–≤–µ–¥–∏—Ç–µ –Ω–æ–º–µ—Ä —Ç–µ–ª–µ—Ñ–æ–Ω–∞
                        </label>
                        <input
                            className="telephone"
                            type="tel"
                            id="phoneNumber"
                            name="phoneNumber"
                            value={phoneNumber}
                            onChange={numberChange}
                            placeholder="–í–≤–µ–¥–∏—Ç–µ –Ω–æ–º–µ—Ä —Ç–µ–ª–µ—Ñ–æ–Ω–∞ "
                            aria-label="Enter phone number"
                            required
                        />
                        </div>
                        <div className='time1'>
                        <select id="dropdown" className='time' required value="–£–¥–æ–±–Ω–æ–µ –≤—Ä–µ–º—è –¥–ª—è –∑–≤–æ–Ω–∫–∞" value={selectedValue} onChange={handleChange}>
                            <option value="">–£–¥–æ–±–Ω–æ–µ –≤—Ä–µ–º—è –¥–ª—è –∑–≤–æ–Ω–∫–∞</option>
                            <option value="option1">11:00</option>
                            <option value="option2">11:30</option>
                            <option value="option3">12:00</option>
                            <option value="option4">12:30</option>
                            <option value="option5">13:00</option>
                            <option value="option6">13:30</option>
                            <option value="option7">14:00</option>
                        </select>
                        </div>

                    </form>
                    <button className='order' onClick={() => setOpen(false)}>–û—Ç–ø—Ä–∞–≤–∏—Ç—å</button>
                </div>

            </div>
        </div> );  // –∞ —ç—Ç–æ —É–∂–µ –∞–Ω–∏–º–∏—Ä–æ–≤–∞–Ω–Ω—ã–π –∫–ª–∞—Å—Å
            }

